import Heading from "./Heading";
import RegisterForm from "./RegisterForm";
import LogInForm from "./LogInForm";

export default App;

function isRegistered() {
    return <LogInForm />
}

function App() {

    return (<div className="container">
        <Heading />
        <RegisterForm />

        <LogInForm />

    </div>);
}
